import React from 'react';

const Input = props => (
  <div>
    <input
      className="profile-input"
      name={props.name}
      onChange={props.handleInputChange}
      placeholder={props.placeholder ? props.placeholder : props.name}
      type={props.type}
      value={props.value}
    />
  </div>
);

export default Input;
